css:
@-moz-document domain("fiks.fit.cvut.cz") {
body{
    background-color: #272727;
    color: #AAA;
}

legend, h1 small, h2 small, h3 small, h4 small, h5 small, h6 small, .h1 small, .h2 small, .h3 small, .h4 small, .h5 small, .h6 small, h1 .small, h2 .small, h3 .small, h4 .small, h5 .small, h6 .small, .h1 .small, .h2 .small, .h3 .small, .h4 .small, .h5 .small, .h6 .small{
    color: #AAA;
}

.navbar-default{
    background-color: #224;
}

.navbar-default .navbar-brand {
    color: #CCC;
}

.navbar-default .navbar-nav>li>a {
    color: #CCC;
}

.navbar-default .navbar-nav>li>a:hover {
    color: #FFF;
}

.panel{
    background-color: #373737;
    color: #BBB;
}

.panel-footer{
    background-color: #272727;
}

.panel-info{
    border-color: #446;
}

.panel-info>.panel-heading{
    border-color: #446;
    background-color: #446;
    color: #EEF;
}

.panel-success{
    border-color: #464;
}

.panel-success>.panel-heading{
    border-color: #464;
    background-color: #464;
    color: #EFE;
}

.panel-default{
    border-color: #666;
}

.panel-default>.panel-heading{
    border-color: #666;
    background-color: #666;
    color: #EEE;
}

.panel-primary{
    border-color: #334;
}

.panel-primary>.panel-heading, .btn-primary{
    border-color: #334;
    background-color: #44A;
    color: #EEE;
}

a{
    color: #88E;
}

a:hover{
    color: #99F;
}

code{
    color: #88E;
    background-color: #202020;
}

.dropdown-menu{
    background-color: #272727;
    color: #AAA;
}

.dropdown-header, .dropdown-menu>li>a{
    color: #AAA;
}

.table-striped>tbody>tr:nth-child(odd)>td, .table-striped>tbody>tr:nth-child(odd)>th {
    background-color: #181818;
}

.nav-tabs>li.active>a, .nav-tabs>li.active>a:hover, .nav-tabs>li.active>a:focus {
    color: #AAA;
    background-color: #181818;
}

.nav>li>a:hover, .nav>li>a:focus {
    text-decoration: none;
    background-color: #181818;
}

.table>thead>tr>td.info, .table>tbody>tr>td.info, .table>tfoot>tr>td.info, .table>thead>tr>th.info, .table>tbody>tr>th.info, .table>tfoot>tr>th.info, .table>thead>tr.info>td, .table>tbody>tr.info>td, .table>tfoot>tr.info>td, .table>thead>tr.info>th, .table>tbody>tr.info>th, .table>tfoot>tr.info>th {
    background-color: #446;
}

.alert-success {
    color: #EFE;
    background-color: #464;
    border-color: #464;
}

.form-control{
    background-color: #777;
    color: #FFF;
}

.form-control[disabled]{
    background-color: #555;
    color: #AAA;
}
}
